import React from "react";
import styled from "styled-components";
import "aos/dist/aos.css";
import Aos from "aos";
import { useEffect } from "react";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

function TenthPage() {
  useEffect(() => {
    Aos.init({ duration: 1000 });
  }, []);
  const settings = {
    dots: true,
    infinite: true,
    speed: 10,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
  };
  return (
    <Container>
      <Wrap1>
        <h1>Freedom to Travel</h1>
        <p>
          Enter a destination on your touchscreen and Trip Planner will
          automatically calculate your route with
        </p>
        <p> Superchargers along the way.</p>
      </Wrap1>

      <Carousel {...settings}>
        <Wrap>
          <a>
            <img src="/images/model-s/LAmap.jpg" alt="steering" />
            <h2>San Jose to Los Angeles</h2>
            <h2>340 miles</h2>
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/Berkleymap.jpg" alt="steering" />
            <h2>Berkeley to Lake Tahoe</h2>
            <h2>178 miles</h2>
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/nymap.jpg" alt="steering" />
            <h2>Manhattan to Boston</h2>
            <h2>211 miles</h2>
          </a>
        </Wrap>
        <Wrap>
          <a>
            <img src="/images/model-s/orlandomap.jpg" alt="steering" />
            <h2>Manhattan to Boston</h2>
            <h2>195 miles</h2>
          </a>
        </Wrap>
      </Carousel>
    </Container>
  );
}

const Container = styled.div`
  height: 160vh;
`;

const Wrap1 = styled.div`
  font-family: "Lato", sans-serif;
  transform: translate(240px, 170px);
  p {
    transform: translateY(20px);
  }
`;

const Carousel = styled(Slider)`
  & > button {
    height: 50%;
    width: 5vw;
    z-index: 1;
  }
  ul li button {
    transform: translate(-300px, 130px);
    border-radius: 50%;
    &:before {
      font-size: 10px;
      color: rgb(249, 249, 249);
    }
  }

  li.slick-active button:before {
    color: white;
  }

  .slick-list {
    overflow: initial;
  }

  .slick-prev {
    left: -75px;
  }

  .slick-next {
    right: -75px;
  }
`;

const Wrap = styled.div`
  transform: translate(70px, 220px);

  position: relative;
  cursor: pointer;

  justify-content: center;
  a {
    border-radius: 1px;

    display: block;
    position: relative;
    padding: 4px;

    img {
      width: 90%;
      height: 85vh;
    }
    h2 {
      color: rgb(56, 56, 56);
      font-family: "Lato", sans-serif;
      font-weight: 600;
      text-border: rgb(0, 0, 0);
      transform: translate(400px, 50px);
      padding-bottom: 10px;
    }

    p {
      color: white;
      font-family: "Lato", sans-serif;
      transform: translate(400px, 50px);
      display: block;
    }
  }
`;

export default TenthPage;
